import React from 'react';
import { motion } from 'framer-motion';
import { 
  HomeIcon, 
  ChartBarIcon, 
  CpuChipIcon,
  SparklesIcon,
  SignalSlashIcon,
  CheckCircleIcon
} from '@heroicons/react/24/outline';

const Header = ({ currentPage, setCurrentPage, systemStatus }) => {
  const navigation = [
    { 
      id: 'dashboard', 
      name: 'Dashboard', 
      icon: HomeIcon,
      description: 'Platform Overview'
    },
    { 
      id: 'predictions', 
      name: 'Predictions', 
      icon: CpuChipIcon,
      description: 'ML Predictions'
    },
    { 
      id: 'analytics', 
      name: 'Analytics', 
      icon: ChartBarIcon,
      description: 'Data Analysis'
    }
  ];

  const getStatusColor = () => {
    switch (systemStatus.status) {
      case 'healthy': return 'bg-green-500';
      case 'degraded': return 'bg-yellow-500';
      case 'error': return 'bg-red-500';
      default: return 'bg-gray-500';
    }
  };

  const getStatusIcon = () => {
    switch (systemStatus.status) {
      case 'healthy': return CheckCircleIcon;
      case 'degraded': return SparklesIcon;
      case 'error': return SignalSlashIcon;
      default: return SignalSlashIcon;
    }
  };

  const StatusIcon = getStatusIcon();

  return (
    <motion.header 
      initial={{ y: -100 }}
      animate={{ y: 0 }}
      className="glass sticky top-0 z-50 border-b border-white/10"
    >
      <div className="container mx-auto px-4 py-4">
        <div className="flex items-center justify-between">
          {/* Logo */}
          <motion.div 
            className="flex items-center space-x-3"
            whileHover={{ scale: 1.05 }}
          >
            <div className="w-10 h-10 bg-gradient-to-br from-blue-500 to-purple-600 rounded-lg flex items-center justify-center">
              <span className="text-white font-bold text-xl">üèè</span>
            </div>
            <div>
              <h1 className="text-xl font-bold gradient-text">Cricket Analytics</h1>
              <p className="text-xs text-gray-400">AI-Powered Insights</p>
            </div>
          </motion.div>

          {/* Navigation */}
          <nav className="hidden md:flex items-center space-x-1">
            {navigation.map((item) => {
              const Icon = item.icon;
              const isActive = currentPage === item.id;

              return (
                <motion.button
                  key={item.id}
                  onClick={() => setCurrentPage(item.id)}
                  className={`relative px-4 py-2 rounded-lg transition-all duration-300 ${
                    isActive 
                      ? 'bg-blue-500/20 text-blue-400 border border-blue-400/30' 
                      : 'text-gray-400 hover:text-white hover:bg-white/10'
                  }`}
                  whileHover={{ scale: 1.05 }}
                  whileTap={{ scale: 0.95 }}
                >
                  <div className="flex items-center space-x-2">
                    <Icon className="w-4 h-4" />
                    <span className="font-medium">{item.name}</span>
                  </div>

                  {/* Tooltip */}
                  <div className="absolute bottom-full left-1/2 transform -translate-x-1/2 mb-2 px-2 py-1 bg-gray-900 text-white text-xs rounded opacity-0 pointer-events-none transition-opacity whitespace-nowrap">
                    {item.description}
                  </div>
                </motion.button>
              );
            })}
          </nav>

          {/* System Status */}
          <div className="flex items-center space-x-4">
            <div className="flex items-center space-x-2">
              <div className={`w-2 h-2 rounded-full ${getStatusColor()} animate-pulse`} />
              <StatusIcon className="w-4 h-4 text-gray-400" />
              <span className="text-sm text-gray-400">
                {systemStatus.status === 'healthy' ? 'Online' : 
                 systemStatus.status === 'degraded' ? 'Degraded' : 'Offline'}
              </span>
            </div>

            {/* Models Status */}
            <div className="hidden sm:flex items-center space-x-2 px-3 py-1 rounded-full bg-white/5">
              <CpuChipIcon className="w-4 h-4 text-blue-400" />
              <span className="text-sm text-gray-400">
                {systemStatus.models_loaded ? 'Models Ready' : 'Loading...'}
              </span>
            </div>
          </div>
        </div>

        {/* Mobile Navigation */}
        <div className="md:hidden mt-4 flex justify-center space-x-2">
          {navigation.map((item) => {
            const Icon = item.icon;
            const isActive = currentPage === item.id;

            return (
              <motion.button
                key={item.id}
                onClick={() => setCurrentPage(item.id)}
                className={`flex flex-col items-center p-3 rounded-lg transition-all duration-300 ${
                  isActive 
                    ? 'bg-blue-500/20 text-blue-400' 
                    : 'text-gray-400 hover:text-white hover:bg-white/10'
                }`}
                whileHover={{ scale: 1.05 }}
                whileTap={{ scale: 0.95 }}
              >
                <Icon className="w-5 h-5 mb-1" />
                <span className="text-xs">{item.name}</span>
              </motion.button>
            );
          })}
        </div>
      </div>
    </motion.header>
  );
};

export default Header;
